import "./Home.scss";
import { Link } from "react-router-dom";
import Typography from "@mui/material/Typography";
import hero from "../assets/images/hero.jpg";
import bottom from "../assets/images/bottom.jpg";
import BrowseArtist from "../components/BrowseArtist/BrowseArtist";

const Home = () => {
  return (
    <div className="home">
      <img className="home__img-top" src={hero} />
      <div className="home__hero">
        <Typography
          variant="h4"
          sx={{ fontFamily: "Arial", color: "white", mb: 2 }}
        >
          Unleash Music's Hidden Gems with DiscoverUs
        </Typography>
        <Typography variant="h7" component="p">
          <div
            className="button-wrapper"
            style={{ display: "flex", gap: "52px", flexDirection: "row" }}
          >
            <Link to="/browse">
              <button className="header__button">Listen</button>
            </Link>
            <Link to="/signup">
              <button className="header__button">Sign Up</button>
            </Link>
          </div>
        </Typography>
      </div>
      <div className="home__artist">
        <BrowseArtist />
      </div>
      <div className="home__closing"></div>
      <main className="home__content"></main>
      <Typography
        variant="h5"
        sx={{ fontFamily: "Arial", color: "white", mb: 2 }}
      >
        Thanks for listening. Now join in. Save tracks, follow artists and build
        playlists. All for free.
      </Typography>
      <Link to="/browse">
        <button className="header__button">Find out more </button>
      </Link>
      <img className="home__img-bottom" src={bottom} />
    </div>
  );
};

export default Home;
